import React, { useState } from "react";

function AddStaff() {
  const [staff, setStaff] = useState({
    fname: "",
    lname: "",
    email: "",
    salary: 0,
    birthDate: "",
    address: "",
    phoneNum: "",
    gender: "",
    staffType: "",
  });

  const onChangeHandler = (e) => {
    console.log(e);
  };

  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        flexDirection: "column",
        height: "100vh",
      }}
    >
      <form
        action=""
        style={{
          display: "flex",
          alignItems: "flex-start",
          flexDirection: "column",
          gap: "25px",
        }}
      >
        <div style={{ width: "90%" }}>
          <label htmlFor="fname">First Name: </label>
          <input type="text" style={{ width: "100%" }} name="fname" />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="lname">LastName: </label>
          <input style={{ width: "100%" }} type="text" name="lname" />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="email">Email: </label>
          <input style={{ width: "100%" }} type="email" name="email" />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="salary">Salary: </label>
          <input style={{ width: "100%" }} type="number" name="salary" />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="birthDate">Birth Date: </label>
          <input style={{ width: "100%" }} type="date" name="birthDate" />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="address">Address: </label>
          <input style={{ width: "100%" }} type="text" name="address" />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="phoneNum">Phone Number: </label>
          <input style={{ width: "100%" }} type="date" name="phoneNum" />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="gender">Gender: </label>
          <input
            style={{ width: "100%" }}
            type="radio"
            name="gender"
            value={"Male"}
          />
          <input
            style={{ width: "100%" }}
            type="radio"
            name="gender"
            value={"Female"}
          />
        </div>
        <div style={{ width: "90%" }}>
          {" "}
          <label htmlFor="staffType">Staff Type: </label>
          <select name="staffType" style={{ width: "90%" }}>
            <option value="Purchase Assistant">Purchase Assistant</option>
            <option value="Sales Assistant">Sales Assistant</option>
          </select>
        </div>

        <button>submit</button>
      </form>
    </div>
  );
}

export default AddStaff;
